import React, { useState } from 'react';
import './App.css';
import { Route, Link, BrowserRouter as Router, Switch } from 'react-router-dom'
import './Login'
import Login from './Login';
import GuardedRoute from 'react-guarded-route'


const IsUserSigned = (checkIfSignedIn) => {
  let isUserSigned = sessionStorage.getItem('userLoggedIn')
  return checkIfSignedIn ? isUserSigned !== null : isUserSigned === null
}

function App() {
  return (
    <Router>
      <Switch>
        <GuardedRoute exact path='/' validatorFunction={IsUserSigned(true)} redirectTo='/login' component={Home()} />
        <GuardedRoute path='/about' validatorFunction={IsUserSigned(true)} redirectTo='/login' component={About()} />
        <GuardedRoute path='/login' validatorFunction={IsUserSigned(false)} redirectTo='/' component={Login} />
      </Switch>
    </Router>
  );
}

function About() {
  return (
    <h1>About</h1>
  )
}

function Home() {
  return (
    <h1>Home</h1>
  )
}

export default App;
